class Solution {
public:
    int numSubarrayProductLessThanK(vector<int> &nums, int k) {
        /*
         * 方法1: 双重循环, 时间超限, 不 AC
         * 时间复杂度 O(n^2), 空间复杂度 O(1)
         */
//        int ans = 0;
//        for (int i = 0; i < nums.size();) {
//            int product = 1;
//            for (int j = i; j < nums.size(); ++j) {
//                product *= nums[j];
//                if (product >= k) {
//                    break;
//                }
//                ++ans;
//            }
//        }
//        return ans;

        /*
         * 方法2: 滑动窗口
         * 时间复杂度 O(n), 空间复杂度 O(1)
         */
//        int i = 0, j = 0, lastJ = -1, product = 1, ans = 0;
//        auto countOfArray = [](int i, int j) { return (j - i + 1) * (j - i + 2) / 2; };
//        while (i < nums.size() && j < nums.size()) {
//            while (j < nums.size()) {
//                if (product * nums[j] >= k) {
//                    break;
//                }
//                product *= nums[j++];
//            }
//            ans += countOfArray(i, j - 1) - countOfArray(i, lastJ);
//            product /= nums[i];
//            lastJ = j - 1;
//            ++i;
//        }
//        return ans;

        /*
         * 方法3: 滑动窗口, 方法2的优化
         * 时间复杂度 O(n), 空间复杂度 O(1)
         */
        int ret = 0;
        // i, j 是左右指针, prod 是数组乘积
        for (int i = 0, j = 0, prod = 1; j < nums.size(); j++) {
            prod *= nums[j];
            while (i <= j && prod >= k) {
                prod /= nums[i];
                i++;
            }
            ret += j - i + 1;  // j 每向右移动一次, 增加的子数组的个数为 (j - i + 1)
        }
        return ret;
    }
};

